    const [count,setCount]=useState(0);
    return(
        <>
           <div className="main_div">
               <div className="center_div">
                   <h1>{count}</h1>
                   <div className="btn_div">
                      <button>Inc</button>
                      <button>Dec</button> 
                   </div>
               </div>
           </div>  
        </>
    );
};
export default IncDec;
